import React, {Component} from 'react';
import './list.css';

class List extends Component {


  render() {
    return (
      <div className = 'main-board'>
        <div className = 'main-board__item'>
          <span>
            아아아
          </span>
        </div>
        <div className = 'main-board__item'>
          <span>
            에에에
          </span>
        </div>
      </div>
    );
  }
}

export default List
